import "./index.css";
const Forms = () => {
  return (
    <div className="row h-100 pt-5">
      <div className="col-md-4 mt-5 border border-2 rounded-2 mx-auto d-flex flex-column align-items-center">
        <h1>Create Room</h1>
      </div>
      <div className="col-md-4 mt-5 border border-2 rounded-2 mx-auto d-flex flex-column align-items-center">
        <h1>Join Room</h1>
      </div>
    </div>
  );
};
export default Forms;
